    position: fixed;
    top: 36px;
    right: 24px;
`

const MessagesWindow = styled.div`
    margin-top: 80px;
    width: 100%;
    height: 80vh;
    background: red;
`

const Chat = () => {
    return (
        <Backdrop>
            <ChatContainer>
                <Cross src='/images/cancel.svg' alt='cross-icon' />
                <MessagesWindow>  <input style={{}} type="text"/></MessagesWindow>

            </ChatContainer>
        </Backdrop>
    )
}

export default Chat
